import React, {Component} from 'react';

export default class Content extends Component{
    render() {
        // let photoFilter = this.props.photos.filter((photo)=>(photo._id === this.props.currentAlbum))
        return (
            <ul>
                {this.props.photos.map((photo)=>
                    (<p key={photo._id}>{this.props.currentAlbum}
                        <button onClick={() => {this.props.setCurrentAlbum(photo._id)}}>
                            {photo.title}
                        </button>
                    </p> ))}
            </ul>
        )
    }
}
